import React from 'react';

const App = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <div className="button-container">
        <button className="button">3D Simulation</button>
        <button className="button">Object Recognition</button>
        <button className="button">NUC</button>
      </div>
      <div className="simulation-window">
        <p>Simulation Window</p>
      </div>
      <div className="camera-window">
        <p>Camera Window</p>
      </div>
      <div className="connection-status">
        <p>NUC Connection Status</p>
      </div>
    </div>
  );
};

export default App;
